    null,ntt"hash": "",ntt"description": "An Area Forecast (FA) is a forecast
    of Visual Flight Rules (VFR) clouds and weather conditions over an area as large
    as the size of several states. The AK area forecast includes Instrument Flight Rules
    (IFR) conditions as well as other AIRMET and SIGMET information. CONUS and HI Area
    Forecasts (FA) together with the AIRMET Sierra bulletin are used to determine forecast
    enroute weather and to interpolate conditions at airports which do not have a terminal
    forecast (TAF) issued.",ntt"format": "",ntt"tracking_summary": {nttt"total":
